import React from 'react';
import { Link } from 'react-router-dom';

function Navbar() {
  const styles = {
    nav: {
      background: 'linear-gradient(90deg, #007BFF, #0056b3)',
      color: 'white',
      padding: '15px 30px',
      display: 'flex',
      justifyContent: 'space-between',
      alignItems: 'center',
      boxShadow: '0px 4px 6px rgba(0, 0, 0, 0.1)',
    },
    brand: {
      fontSize: '1.5rem',
      fontWeight: 'bold',
      color: 'white',
      textDecoration: 'none',
    },
    links: {
      display: 'flex',
      gap: '20px',
    },
    link: {
      color: 'white',
      textDecoration: 'none',
      fontSize: '1rem',
      fontWeight: 'bold',
      transition: 'color 0.3s ease',
    },
    linkHover: {
      color: '#FFD700',
    },
  };

  return (
    <nav style={styles.nav}>
      <Link to="/" style={styles.brand}>My App</Link>
      <div style={styles.links}>
        <Link to="/" style={styles.link}>Landing Page</Link>
        <Link to="/events" style={styles.link}>View All Events</Link>
      </div>
    </nav>
  );
}

export default Navbar;
